(4153,1,"2018-11-21 12:02:42","2018-11-21 12:02:42","<h4>Cum praesertim illa perdiscere ludus esset</h4>\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Hoc ipsum elegantius poni meliusque potuit. Duo Reges: constructio interrete. Sit, inquam, tam facilis, quam vultis, comparatio voluptatis, quid de dolore dicemus? Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis.\n\nClaudii libidini, qui tum erat summo ne imperio, dederetur. Teneo, inquit, finem illi videri nihil dolere. Est enim effectrix multarum et magnarum voluptatum. O magnam vim ingenii causamque iustam, cur nova existeret disciplina! Perge porro.\n\nDolere malum est: in crucem qui agitur, beatus esse non potest. Non potes, nisi retexueris illa. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? <i>Prave, nequiter, turpiter cenabat;</i> A primo, ut opinor, animantium ortu petitur origo summi boni. Sed potestne rerum maior esse dissensio? Quia nec honesto quic quam honestius nec turpi turpius. Ex eorum enim scriptis et institutis cum omnis doctrina liberalis, omnis historia. Theophrasti igitur, inquit, tibi liber ille placet de beata vita? Vitiosum est enim in dividendo partem in genere numerare.\n\nAd eas enim res ab Epicuro praecepta dantur. Quamquam te quidem video minime esse deterritum. Omnes enim iucundum motum, quo sensus hilaretur. Esse enim quam vellet iniquus iustus poterat inpune. Quid censes in Latino fore? Tantum dico, magis fuisse vestrum agere Epicuri diem natalem, quam illius testamento cavere ut ageretur. <i>Est enim effectrix multarum et magnarum voluptatum.</i> Facit igitur Lucius noster prudenter, qui audire de summo bono potissimum velit;\n<h4>Si longus, levis dictata sunt.</h4>\nQuae tamen a te agetur non melior, quam illae sunt, quas interdum optines. Collatio igitur ista te nihil iuvat. Eam si varietatem diceres, intellegerem, ut etiam non dicente te intellego; Hoc tu nunc in illo probas. Bonum integritas corporis: misera debilitas. Sed quanta sit alias, nunc tantum possitne esse tanta. Se dicere inter honestum et turpe nimium quantum, nescio quid inmensum, inter ceteras res nihil omnino interesse.\n\nNon minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Itaque si aut requietem natura non quaereret aut eam posset alia quadam ratione consequi. Quaero igitur, quo modo hae tantae commendationes a natura profectae subito a sapientia relictae sint. An, partus ancillae sitne in fructu habendus, disseretur inter principes civitatis, P. Si quicquam extra virtutem habeatur in bonis. Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. <i>Nam quid possumus facere melius?</i>\n\nEodem modo is enim tibi nemo dabit, quod, expetendum sit, id esse laudabile. Aliter enim explicari, quod quaeritur, non potest. Ex ea difficultate illae fallaciloquae, ut ait Accius, malitiae natae sunt. Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. Respondeat totidem verbis. Hic quoque suus est de summoque bono dissentiens dici vere Peripateticus non potest. Quid ergo? Est enim effectrix multarum et magnarum voluptatum. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Etenim semper illud extra est, quod arte comprehenditur.\n\nQuod eo liquidius faciet, si perspexerit rerum inter eas verborumne sit controversia. Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. <i>Quae quo sunt excelsiores, eo dant clariora indicia naturae.</i> Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri.\n\n<i>Teneo, inquit, finem illi videri nihil dolere.</i> Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Quae quidem vel cum periculo est quaerenda vobis; Non ego tecum iam ita iocabor, ut isdem his de rebus, cum L. Tibi hoc incredibile, quod beatissimum. <b>Obsecro, inquit, Torquate, haec dicit Epicurus?</b> <i>Bonum negas esse divitias, praeposÃ¬tum esse dicis?</i> Ut optime, secundum naturam affectum esse possit. <b>Quis istud possit, inquit, negare?</b> Quae adhuc, Cato, a te dicta sunt, eadem, inquam, dicere posses, si sequerere Pyrrhonem aut Aristonem.\n<h4>Aliter enim explicari, quod quaeritur, non potest.</h4>\nQuam multa vitiosa! summum enim bonum et malum vagiens puer utra voluptate diiudicabit, stante an movente? Saepe ab Aristotele, a Theophrasto mirabiliter est laudata per se ipsa rerum scientia; Istam voluptatem perpetuam quis potest praestare sapienti? Negat enim summo bono afferre incrementum diem. Ab hoc autem quaedam non melius quam veteres, quaedam omnino relicta. Sed haec quidem liberius ab eo dicuntur et saepius. Ac tamen hic mallet non.","Never stop dreaming","","publish","open","open","","qui-autem-esse-poteris","","","2018-11-21 12:02:42","2018-11-21 12:02:42","",0,"https://demo.themeisle.com/hestia-default/?p=4153",0,"post","",0),
(4154,1,"2018-11-21 12:04:19","2018-11-21 12:04:19","<h4>Duo Reges: constructio interrete</h4>\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Cur id non ita fit? Cupiditates non Epicuri divisione finiebat, sed sua satietate. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Ita ne hoc quidem modo paria peccata sunt.\n\nSi qua in iis corrigere voluit, deteriora fecit. Quamquam non negatis nos intellegere quid sit voluptas, sed quid ille dicat. Qui autem voluptate vitam effici beatam putabit, qui sibi is conveniet, si negabit voluptatem crescere longinquitate? Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. Magni enim aestimabat pecuniam non modo non contra leges, sed etiam legibus partam. Quicquid porro animo cernimus, id omne oritur a sensibus;\n<ol>\n 	<li>Nisi enim id faceret, cur Plato Aegyptum peragravit, ut a sacerdotibus barbaris numeros et caelestia acciperet?</li>\n 	<li>Et quidem illud ipsum non nimium probo et tantum patior, philosophum loqui de cupiditatibus finiendis.</li>\n 	<li>Quamquam in hac divisione rem ipsam prorsus probo, elegantiam desidero.</li>\n 	<li>Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur.</li>\n</ol>\nVarietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Bonum integritas corporis: misera debilitas. Ergo id est convenienter naturae vivere, a natura discedere. Expectoque quid ad id, quod quaerebam, respondeas. Sine ea igitur iucunde negat posse se vivere? Nam quid possumus facere melius? Bonum negas esse divitias, praeposÃ¬tum esse dicis? Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Fortitudinis quaedam praecepta sunt ac paene leges, quae effeminari virum vetant in dolore. Vide, quantum, inquam, fallare, Torquate.\n\nQua tu etiam inprudens utebare non numquam. Nec vero sum nescius esse utilitatem in historia, non modo voluptatem. Quae hic rei publicae vulner